import React, { useEffect, useState } from "react";
import Navbarcomponent from "../navbar";
import axios from "axios";
import { Table } from "react-bootstrap";
import { useParams } from "react-router";

function BookingStatus() {
  const [customerBook, setCustomerBook] = useState([]);
  const { id } = useParams();

  useEffect(() => {
    axios
      .get(`http://localhost:8182/customerBook/customerId/${id}`)
      .then((response) => {
        console.log("API response:", response.data);
        setCustomerBook(response.data);
      })
      .catch((error) =>
        console.error("Error fetching customer books:", error)
      );
  }, [id]);

  return (
    <div>
      <Navbarcomponent />
      <h1>Booking Status</h1>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Id</th>
            <th>Issue Date</th>
            <th>Return Date</th>
            <th>Fine</th>
          </tr>
        </thead>
        <tbody>
          {customerBook && (
            <tr key={customerBook.id}>
             
              <td>{customerBook.issueDate}</td>
              <td>{customerBook.returnDate}</td>
              <td>{customerBook.amount}</td>
            </tr>
          )}
        </tbody>
      </Table>
    </div>
  );
}

export default BookingStatus;
